 e) wenn der Generalpächter ohne zwingenden Grund trotz einer schriftlich gesetzten angemessenen 
Frist das Grundstück (den Grundstücksteil) nicht unterverpachtet oder nicht dafür sorgt,  daß das 
Grundstück (der Grundstücksteil) kleingärtnerisch genutzt wird; 
 f) wenn  dem  Verpächter  aus  dem  Fortbestande  des  Pachtverhältnisses  ein  unverhältnismäßig

Grundstück (der Grundstücksteil) kleingärtnerisch genutzt wird; 
 f) wenn  dem  Verpächter  aus  dem  Fortbestande  des  Pachtverhältnisses  ein  unverhältnismäßig 
größerer Nachteil erwüchse als dem Generalpächter und den Unterpächtern aus der Kündigung.

Kleingärtnervereines  oder  Verbandes  der  Kleingärtnervereine  verpflichtet  ist,  trotz  einer  nach 
Eintritt  der  Fälligkeit  mittels  eingeschriebenen Briefes  ausgesprochenen  Mahnung  länger  als 
einen Monat im Rückstande bleibt; 
 b) der  Unterpächter  durch  sein  rücksichtsloses,  anstößiges  oder  sonst  grob  ungehöriges  Verhalten 
anderen Kleingärtnern das Zusammenleben verleidet; 
 c) der  Unterpächter  sich  gegenüber  dem  Grundeigentümer  oder  dem  Generalpächter  oder  deren

körperliche  Sicherheit  schuldig  macht,  sofern  es  sich  nicht  um  Fälle  handelt,  die  nach  den 
Umständen als geringfügig zu bezeichnen sind; 
 d) der Unterpächter den Kleingarten ohne zwingenden Grund länger als ein Jahr nicht im Sinne des 
§ 1  Abs. 1  verwendet  oder  trotz  erfolgter  Mahnung  die  ihm  bekanntgegebenen  erheblichen 
Bewirtschaftungsmängel innerhalb einer schriftlich gesetzten angemessenen Frist nicht abstellt;
